"use client"

import Image from "next/image";

const Alphabet01 = () => {

    let text:string = "aaa aa"
    let size:number = 200

    return (
        <div style={{display:"flex"}}>
            {text.split("").map((letter,index)=>(
                <Image
                src={`/paper-font/${letter}.png`}
                width={size}
                height={size}
                alt=""
                key={`${letter}${index}`}
                />
            ))}
        </div>
    );
}
 
export default Alphabet01;

